import React from "react";
import { Link } from "react-router-dom";

const ProductsListItems=({product})=>{
    const{price,category,subs,color,brand,quality,sold,shipping}=product
    return(
       <ul className="list-group">
           <li className="list-group-item">
               Price{" "}
               <span >
                   ${price}
               </span>
           </li>
           {category && category.length?(<li className="list-group-item">
               Category:{" "}
               <Link to={`/category/${category.slug}`} className="label label-default label-pill pull-xs-right">
                    ${category.name}
               </Link>
           </li>):(<li className="list-group-item">
               Category:{" "}
               <span className="label label-default label-pill pull-xs-right">
                   No Category
               </span>
           </li>)}
           {subs &&(<li className="list-group-item">
               Sub-Category{" "}
               {subs.map((s)=>{
                   <Link to={`/subs/s.slug`} key={s._id} className="label label-default label-pill pull-xs-right">
                   ${s.name}
               </Link>
               })}
               
           </li>)}
           
           <li className="list-group-item">
               Shipping{" "}
               <span className="label label-default label-pill pull-xs-right">
                   :{shipping}
               </span>
           </li>
           <li className="list-group-item">
               Color{" "}
               <span className="label label-default label-pill pull-xs-right">
                   :{color}
               </span>
           </li>
       </ul>
    )
}
export default ProductsListItems
